        '<p><span style=\"color: rgb(18, 18, 18); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: medium;\">根据国家住建部有关生活垃圾分类文件要求和《2019年长沙市生活垃圾分类工作方案》，生活垃圾分为其他垃圾、厨余垃圾、可回收物和有害垃圾，厨余垃圾由绿色垃圾桶回收。</span><br></p>',
        'ae6e8b3bbfe34d4b865559599a7cf866-fec0f3254e3c467685e1d1576cb1e5db-262b53f54c0b47a98afed9baef7685b6-2c13f17d28bb450085b94e1537cd9bf6',
        'ae6e8b3bbfe34d4b865559599a7cf866-', '2023-12-03 08:30:36', '2023-12-03 08:34:41'),
       ('3e83008c0b1344b48c0ab8bfe7d68aac', '包了口香糖的纸巾属于哪一类垃圾？', 5, 'a1b661031adf4a8f969f1869d479fe74', 3,
        1,
        '<p><span style=\"color: rgb(18, 18, 18); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: medium;\">包了口香糖、擦了鼻涕的纸巾都是其他垃圾。</span><br></p>',
        '198b15232704461eb34a9167baaf3e69-6ccb034077074897b4860da506d546e1-cca2b78e05da48cab584626fecc512df-11ec4d81ad26431187946e55ab6a2133',
        '198b15232704461eb34a9167baaf3e69-', '2023-12-03 06:44:46', '2023-12-03 07:05:54'),
       ('79f7cef64df74cca91b16d70b413fed3', '大骨棒是其他垃圾。', 5, 'a1b661031adf4a8f969f1869d479fe74', 1, 3,
